import React from 'react';
import './AboutUsPage.css';
import aboutUsImage from './images/about-us-new.jpg';
import teamProfilesImage from './images/team-profiles.jpg';
import companyHistoryImage from './images/company-history.jpg';

const AboutPage = () => {
  return (
    <div className="about-us">
      <h2>About Us</h2>
      <div className="about-section">
        <img src={aboutUsImage} alt="About Us" />
        <p>
          Welcome to our company! We are dedicated to providing the best services in Dubai. Our team of professionals is here to assist you with all your needs and ensure your satisfaction.
        </p>
      </div>
      <div className="team-section">
        <h3>Our Team</h3>
        <img src={teamProfilesImage} alt="Team Profiles" />
        <p>
          Our team is comprised of experts in various fields, all working together to deliver top-notch solutions for our clients.
        </p>
      </div>
      <div className="history-section">
        <h3>Our History</h3>
        <img src={companyHistoryImage} alt="Company History" />
        <p>
          Since our establishment, we have been at the forefront of innovation and excellence. Our history is a testament to our commitment to quality and our drive to be the best in the industry.
        </p>
      </div>
    </div>
  );
}

export default AboutPage;
